import React from 'react'
import ListGroup from 'react-bootstrap/ListGroup'

export default function Result(props) {
    const {item}=props;
   const displayItems=items.props.map(i=>(
    <ListGroup.Item variant="success">{i}</ListGroup.Item>
   ))

    return (
        <div>
            <ListGroup>
               {displayItems}
            </ListGroup>
        </div>
    )
}
